import * as React from "react";
import DateSelector from "../../components/cards/dataselector";
import Paymenthistory from "../../components/cards/paymenthistory";

function Card({ children, style }) {
    return (
        <div style={style}>{children}
        <style jsx>{`
                .card {
                    border-radius: 12px;
                    box-shadow: 0px 4px 4px 0px rgba(0, 0, 0, 0.25);
                    background-color: #939393;
                    width: 100%;
                    margin-top: 200px; /* Add margin to the top */
                }
                `}</style>
        </div>
        

);
}

function SubscriptionsReport() {
    const cards = [
        { id: 1, content: <DateSelector/>},
        { id: 2, content: <Paymenthistory/> },
    ];
    return (
        <>
            <main className="subscriptions-report">
                <h1 className="report-title">Subscriptions Report</h1>
                {cards.map((card) => (
                <div className="margin">
                     <Card key={card.id}>
                    {card.content}
                </Card>
                </div>
               
            ))}
            </main>

            <style jsx>{`
                .subscriptions-report {
                    display: flex;
                    max-width: 100%;
                    flex-direction: column;
                    font-size: 32px;
                    color: #fecc09;
                    font-weight: 700;
                    letter-spacing: 1.6px;
                    padding-left: 80px; /* Add left padding */
                    padding-right: 80px; /* Add right padding */
                    overflow-x: hidden;
                }

                .report-title {
                    font-family: Poppins, sans-serif;
                    width: 100%;
                }

                @media (max-width: 991px) {
                    .report-title {
                        max-width: 100%;
                    }
                }

                .margin{
                    margin-bottom: 20px
                }

                .report-section {
                    border-radius: 12px;
                    box-shadow: 0px 4px 4px 0px rgba(0, 0, 0, 0.25);
                    background-color: #939393;
                    min-height: 134px;
                    margin-top: 14px;
                    width: 80%;
                }

                .report-section.large {
                    border-radius: 20px;
                    min-height: 289px;
                    margin-top: 43px;
                    width: 80%
                }

                @media (max-width: 991px) {
                    .report-section {
                        max-width: 100%;
                    }

                    .report-section.large {
                        margin-top: 40px;
                    }
                }
            `}</style>
        </>
    );
}

export default SubscriptionsReport;
